import React from 'react'

const Footer = () => {
  return (
    <div>
        <footer className='p-3 bg-secondary text-light text-center footer mt-5'> 
            <div className='container'>
                <p className='lead'> Copyright &copy; 2023 Online Exam</p>
            </div>
        </footer>

    </div>
  )
}

export default Footer
